  return (
    <div>
      <div className='cardfeatures'>
      <Swiper
        pagination={{
          type: 'progressbar',
        }}
        navigation={true}
        modules={[Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
        
        </SwiperSlide>
        <SwiperSlide>
        <ul>
          <li className='ty'>RUM</li>
        </ul>
        </SwiperSlide>
        
      </Swiper>
      </div>
      <ul>
        <li>tea</li>
      </ul>
    </div>
  )
}

export default Demo
